function UlFlex(props) {
    console.log(props.img[0])
    if (props.count === 4) {
        return (
            <div>
                <ul>
                    <li>{props.img[0]}</li>
                    <li>{props.img[1]}</li>
                    <li>{props.img[2]}</li>
                    <li>{props.img[3]}</li>
                </ul>
            </div>
        )
    } else if (props.count === 6) {
        return (
            <div>
                <ul>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                    <li></li>
                </ul>


            </div>
        )
    } else {
        console.log('ERROR IN UlFlex.js')
    }


}
export default UlFlex;
